const TradeDetail = () => {
    return ( 
        <div className="container mt-100">
            <div className="row">
                <div className="col-md-2"></div>
                <div className="col-md-8">
                    <div className="row">
                        <div className="col-md-2">
                            <img src={car} width={200} height={150}/>
                        </div>

                    </div>
                </div>
                <div className="col-md-2"></div>
            </div>
        </div>
     );
}

export default TradeDetail;
